import React from 'react'
import { AiOutlineWarning } from 'react-icons/ai'
let color = 'black'
export default function ErrorMsg(msg) {
    return (
        <div className = 'mx-auto' style = {ErrorStyle}>
            <AiOutlineWarning color = {color}/>
           <span> {msg}</span>
        </div>
    )
}

let ErrorStyle = {
    width: '30rem',
    border: '1.5px solid red',
    padding: '4px 10px',
    margin: '5px'
}
